import React from 'react';
import PropTypes from 'prop-types';

const Category = ({ category }) => (
  <section>
    <h1>Category page: {category.title}</h1>

  </section>
);

Category.propTypes = {
    category: PropTypes.shape({}).isRequired,
};

export default Category;
